import React from "react";
import { Menu } from './Home.js';

const Testimonial = () => {
    return(
      <div>
        <Menu/>
        <h1>Testimonial Page</h1>
        <pre>
          {
              `int B[][] = new int[n + 1][W + 1];
          
            for (int i=0; i<=n; i++)
                      for (int j=0; j<=W; j++) {
                  B[i][j] = 0;
              }
          
            for (int i = 1; i <= n; i++) {
                  for (int j = 0; j <= W; j++) {
                      B[i][j] = B[i - 1][j];
          
                      if ((j >= wt[i-1]) && (B[i][j] < B[i - 1][j - wt[i - 1]] + val[i - 1])) {
                          B[i][j] = B[i - 1][j - wt[i - 1]] + val[i - 1];
                      }
                  }
              }
            while (n != 0) {
                  if (B[n][W] != B[n - 1][W]) {
                      W = W - wt[n-1];
                  }
                  n--;
              }
              return B[n][W];`
          }
        </pre>
      </div>
    );
  }

  export default Testimonial;
